    "digital-data-sets-that-describe-aquifer-characteristics-of-the-alluvial-and-terrace-deposits-ald9d7e",nt"isopen":
    false,nt"url": null,nt"notes": "This data set consists of digital aquifer
    boundaries for the alluvial and terrace deposits along the North Canadian River
    from Oklahoma City to Eufaula Lake in east-central Oklahoma. Ground water in 710
    square miles of Quaternary alluvial and terrace deposits along the North Canadian
    River is an important source of water for irrigation, industrial, municipal, stock,
    and domestic supplies. The aquifer, composed of alluvial and terrace deposits, consists
    of sand, silt, clay, and gravel. The aquifer is underlain and in hydraulic connection
    with the upper zone of the Permian-age Garber-Wellington aquifer and the Pennsylvanian-age
    Ada-Vamoosa aquifer. The aquifer boundaries were digitized from a published ground-water
    modeling report and some lines were extracted from published digital geology data
    sets.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
